import React from "react";

function Navbar() {
  return (
    <>
      <div className="flex text-blue-900 justify-between p-2">
        <div>SlotLane</div>
        <div className="flex gap-16">
          <a href="#">Home</a>
          <a href="#">Bookings</a>
        </div>
      </div>
    </>
  );
}

export default Navbar;
